import React from 'react';
import { ButtonGroup, Button } from 'react-bootstrap';


export const Continents = ({ continents, onClick }) => {
    return (
        <div>
            <ButtonGroup size="lg">
                {continents.map(cont =>
                    <Button variant="secondary" onClick={onClick(cont)}>
                        {cont}
                    </Button>
                )}
            </ButtonGroup>
        </div>
    )
}
